import React, { useContext } from 'react'

const Product = (props) => {

    const product = {
      seq: props.seq,
      name: props.name,
      asin: props.asin,
      price: props.price,
      buylink : props.buylink,
      imglink : props.imglink,
      category : props.category
    };


  return (
    <li>
      {props.price}
    </li>
  )
}

export default Product
